import '../css/App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState } from "react";
import {useNavigate} from 'react-router-dom'
import hodu from '../congratulationsHodu.png'

function SignUpComplete(){
    return(
        <div className='todo-container'>
            <h1 style = {{fontSize : 50}}>You're now a member of Ho-Do List</h1>
            <div style={{textAlign : "center", marginTop:30}}>
                <img style={{width:300}}src={hodu}/>
                <button className = 'purpleButton' style = {{marginTop: 30,height:50, fontSize:20, width:"100%"}} 
                type = 'submit'>Home</button>
            </div>
        </div>
    )
}


export default SignUpComplete
